import React, { Component } from "react";
import { Card,ResponsiveEmbed} from "react-bootstrap";

export default class showVideo extends Component {
  render() {
    return (
      <div>
        <Card>
          <Card.Body>
            <div style={{ width: 660, height: "auto" }}>
              <ResponsiveEmbed aspectRatio="16by9">
                <embed
                  type="image/svg+xml"
                  src="https://www.youtube.com/watch?v=jZ7LFwaggyI"
                />
              </ResponsiveEmbed>
            </div>
          </Card.Body>
        </Card>
      </div>
    );
  }
}
